import React from 'react'
import '../../App.css';

const menuContainer = (props) => {
    var text = props.page
    if(text==="Inicio"){
        return (
            <div className="inicio">
                <p>
                    Bienvenido al restaurante!
                </p>
            </div>
        )
    }
    else{
        return (
            <div className={props.css} >
                H
            </div>
        )
    }

};

export default menuContainer;
